    data: |
      SELECT DISTINCT - col2 col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE CAST ( NULL AS INTEGER ) NOT IN ( - + col1 - + 28 * + 80 * + + col1 * - + col2, col1 * - col0 * + + 91, - CAST ( NULL AS REAL ), col2 );
  - name: tab1

outputs:
  - name: q3072.out
    data: |
